response.activities:
▪︎Приветствую всех на моей странице!
Имея большой опыт в проектировании и реализации Дизайн-проектов помогу,   вам создать интерьер вашего дома, квартиры или рабочию среду для офиса. Люблю сочетать натуральные  оттенки цветовой палитры. И создавать освещение, созвучное с естественным  биоритмом человека. Всегда на стороне экологически чистых  материалов для ремонта. Работаю с проверенными поставщиками и строителями. 

Немного о моем образовании: 

-Закончила УдГУ кафедра ИИиД. Промышленный дизайн в 2008г.
-В дизайне интерьера с 2010 года
-Обучалась в школе Санкт-Петербург "Умный Дизайнер"Полины Афонской 
-Постоянно повышаю свои профессиональные навыки.
-Состою в сообществе дизайнеров Удмуртии. 

▪︎В последний год сдали проекты квартир в:
Ж.К Знак 76кв/м;
Ж.К Аксиома 54кв/м;
Ж.К Матрешки 100кв/м; 
Ж.К Новый город 86кв/м;
Ж.К.5Континентов 56 кв/м; 
Ж.К. Новый Калудский 42кв/м;
Ж.К. Елки 30кв/м;
Ж.К. Седьмое небо 58кв/м.

